import React from "react";
import { useEffect, useState } from "react";
import { Card, CardMedia, CardContent, CardActions, Avatar, Tooltip, Button, IconButton, Typography,  TextField, Alert, Link  } from "@mui/material";

export default function SecretGroup({userData}) {
    const [groupData, setGroupData] = useState();

    const getSecretData = async () => {
        const fetchReq = await fetch("/api/get-secret-group")
        const response = await fetchReq.json();
        setGroupData(response)
    }

    useEffect(()=> {
        getSecretData()
    },[])

  return ( 
  <Card sx={{ m: 2 }}>
    {groupData &&       <CardMedia
        component="img"
        height="40%"
        image={groupData.group_photo_url}
        alt="2 girls celebrating the holidays"
      /> }

    <CardContent>
        I am card contented

    </CardContent>

  </Card>
  );

}
